import { Component } from "react"

export default class RobotInGame extends Component() {
    status = {
        x: 200,
        y: 200
    }
    getIntialState() {
        return {
            x: 150,
            y: 150
        }
    }
    render() {
        var style = {
            width: this.status.x,
            height: this.status.y,
            position: "absolute",
            top: "100px",
            left: "100px",
            backgroundColor: "red"
        }
        return (<div style={style}></div>);
    }
}
